import ExpenseItem from "./components/ExpenseItem";
import './components/ExpenseItem.css'

function App() {
  var expenses = [
    {
      id:0,
      date: new Date(2022, 2, 25),
      title: 'Toilet Papers',
      amount: 1545.3
    },
    {
      id:0,
      date: new Date(2021, 3, 26),
      title: 'Toilet Papers',
      amount: 459.3
    },
    {
      date: new Date(2020, 4, 27),
      title: 'Toilet Papers',
      amount: 779.86
    }
  ]

  return (
    <div>
      <ExpenseItem />
    </div>
  );
}

export default App;
